    return (
        <div className=" flex   flex-col justify-center w-full  ">

            <div className="mt-6 w-full">
                <SearchBar />

            </div>
            <div>
                <h1 className="font-bold text-xl">
                    Frames
                </h1>
            </div>

        </div>
    )
};
export default BackgroundSelector;
